import React from 'react';

function About() {
  return (
    <section id="about" className="section">
      <h2>About Me</h2>
      <p>
        Hi, I'm Utkarsh. I'm a passionate cloud & DevOps engineer with expertise in golang, javascript, devops tools like docker, kubernetes, argocd, keptn, glasskube, helm and many more.
        I have 1 years of experience in cloud & DevOps, and I enjoy helping organizations with their cloud and devops related work.
        Feel free to explore my portfolio and get in touch!
      </p>
    </section>
  );
}

export default About;
